import React from 'react';

const Login = () => {

  const style = {
    margin : "20px",
  };

  return (
    <>
    <div>
        <h1>회원가입</h1>
    </div>
    <hr />
    <form>
    <div style={style}>
      <h2>Login Page</h2>
      <p>This is the about page content.</p>
    </div>
    </form>
    </>
  );
};

export default Login;
